import React from "react";
import Cards from "./Cards";
import Sdata from "./Sdata";

console.log(Sdata[0]);

function App(){
    return(
        <>
            <div className="container">
                <h1>Featured Products</h1>
                <Cards 
                imgsrc={Sdata[0].imgsrc} 
                category={Sdata[0].categorys} 
                title={Sdata[0].titles} 
                link={Sdata[0].links} />
                <Cards 
                imgsrc={Sdata[0].imgsrc} 
                category={Sdata[0].categorys} 
                title="Letterhead" 
                link={Sdata[0].links} />
                <Cards 
                imgsrc={Sdata[0].imgsrc} 
                category={Sdata[0].categorys} 
                title={Sdata[0].titles} 
                link={Sdata[0].links} />
            </div>
        </>
    );
}   

export default App;
